// AnesthesiaSecondYear.js
import React from 'react';
import FormComponentAnesthesia2 from '../../components/FormComponentAnesthesia';

const subjectsData = [
  {
    subject: 'Anatomy & Physiology',
    internalMax: 20,
    internalSecured: 18,
    theoryMax: 60,
    theorySecured: 48,
    practicalMax: 20,
    practicalSecured: 18
  },
  {
    subject: 'Microbiology',
    internalMax: 20,
    internalSecured: 16,
    theoryMax: 60,
    theorySecured: 45,
    practicalMax: 20,
    practicalSecured: 17
  },
  {
    subject: 'Anesthesia Technology',
    internalMax: 20,
    internalSecured: 19,
    theoryMax: 60,
    theorySecured: 50,
    practicalMax: 20,
    practicalSecured: 20
  }
  // Add more subjects if needed...
];

const AnesthesiaSecondYear = () => {
  return (
    <FormComponentAnesthesia2
      title="Second Year B.Sc. Anesthesia Technology Marks Memo"
      subjectsData={subjectsData}
    />
  );
};

export default AnesthesiaSecondYear;
